import { useTheme } from '@mui/material/styles';
import { AreaChart, Line, XAxis, YAxis, Label, ResponsiveContainer, Area, Tooltip, CartesianGrid } from 'recharts';
import Title from './Title';

import axios from 'axios';
import React, { useEffect, useState} from 'react';
import qs from 'qs';

var port=1;

const DataRequest = ({}) => {
  const [data, setData] = useState([]);
  useEffect(() => {
    axios.get('/data/SmartView/usageAndBill.json')
      .then((res) => {
      const dataTemp = res.data[tabButtonKey].map((data) => {
        return {
          xAxis: data.MR_HHMI,
          usage: data.F_AP_QT,
          usageLast: data.LYEAR_F_AP_QT,
          bill: data.KWH_BILL,
        };
      });
      setUsageStatus([{}, ...dataTemp, {}]);
    });
  }, [tabButtonKey]);
    
  return (
      <React.Fragment>
        <Title>Today</Title>
        <ResponsiveContainer width="100%" height="100%">
        <AreaChart
          width={500}
          height={400}
          data={data}
          margin={{
            top: 10,
            right: 30,
            left: 0,
            bottom: 0,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="data.date" />
          <YAxis />
          <Tooltip />
          <Area type="monotone" dataKey="min" stackId="1" stroke="#8884d8" fill="#8884d8" />
          <Area type="monotone" dataKey="average" stackId="1" stroke="#82ca9d" fill="#82ca9d" />
          <Area type="monotone" dataKey="max" stackId="1" stroke="#ffc658" fill="#ffc658" />
        </AreaChart>
      </ResponsiveContainer>
      </React.Fragment>
    );
  
}

export default DataRequest;
